import { Input, Menu } from 'semantic-ui-react'
import NavBar from "./NavBar";


const headerStyle = {
    position: "relative",
    // width: "170px",
    // height: "40px",
    // left: "calc(50% - 170px/2 + 121px)",
    background: "url(https://images.pexels.com/photos/598917/pexels-photo-598917.jpeg?auto=compress&cs=tinysrgb&dpr=3&w=500)",


    // width: "2309px",
    height: "700px",
    backgroundRepeat:"no-repeat",
    backgroundSize:"content",
    fontFamily: "Alegreya Sans",
    fontFtyle: "normal",
    fontWeight: "normal",
    fontSize: "30px",
    lineHeight: "36px",
    color: "#F0D8D8",
    backgroundPosition:"center",
    opacity:.1
  };
  
  const Header = () => (
    <div className="Header" style={headerStyle}>
         <NavBar />
         <div className="container">
            <div className="row">
              <div className="col">
                <h2 className="font-weight-bolder">Photography For the Future</h2>
                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna</p>
              </div>
              <div className="col">

              </div>
            </div>
         </div>

    </div>
  );
  
  export default Header;
